  \"2015-09-27T03:20:20.430785\",\n\t\"name\": \"southeast-alaska-esi-nests-nest-points\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains biological resource
  data for alcids, shorebirds, waterfowl, diving birds, pelagic birds, gulls, and
  terns in Southeast Alaska. Points in this data set represent locations of bird nesting
  sites. Species-specific abundance, seasonality, status, life history, and source
  information are stored in relational data tables (described below) designed to be
  used in conjunction with this spatial data layer. See also the BIRDS (Bird Polygons)
  data layer, part of the larger Southeast Alaska ESI database, for additional bird
  information.This data set comprises a portion of the Environmental Sensitivity Index
  (ESI) data for Southeast Alaska. ESI data characterize the marine and coastal environments
  and wildlife by their sensitivity to spilled oil. The ESI data include information
  for three main components: shoreline habitats, sensitive biological resources, and
  human-use resources. See also the BIRDS (Bird Polygons) data layer, part of the
  larger Southeast Alaska ESI database, for additional bird information.\",\n\t\"license_title\":
